function notifyWarrantyCreated(warrantyId, createdBy) {
    const { addNotification } = useNotificationStore();
    addNotification({
        type: 'warranty',
        title: 'Phiếu bảo hành mới',
        message: `Phiếu ${warrantyId} đã được tạo`,
        link: `/warranty/${warrantyId}`,
        createdBy
    });
}
function notifyWarrantyStatusChanged(warrantyId, newStatus, changedBy) {
    const { addNotification } = useNotificationStore();
    addNotification({
        type: 'warranty',
        title: 'Cập nhật trạng thái',
        message: `Phiếu ${warrantyId} đã chuyển sang ${newStatus}`,
        link: `/warranty/${warrantyId}`,
        createdBy: changedBy
    });
}
function notifyMention(mentionedBy, context, link) {
    const { addNotification } = useNotificationStore();
    addNotification({
        type: 'mention',
        title: 'Bạn được nhắc đến',
        message: `${mentionedBy} đã nhắc bạn trong ${context}`,
        link,
        createdBy: mentionedBy
    });
}
function notifyComment(commentBy, context, link) {
    const { addNotification } = useNotificationStore();
    addNotification({
        type: 'comment',
        title: 'Bình luận mới',
        message: `${commentBy} đã bình luận trong ${context}`,
        link,
        createdBy: commentBy
    });
}
function notifyOrderCreated(orderId, createdBy) {
    const { addNotification } = useNotificationStore();
    addNotification({
        type: 'order',
        title: 'Đơn hàng mới',
        message: `Đơn ${orderId} đã được tạo`,
        link: `/orders/${orderId}`,
        createdBy
    });
}
function notifySystem(title, message) {
    const { addNotification } = useNotificationStore();
    addNotification({
        type: 'system',
        title,
        message
    });
}
